import SearchIcon from '@material-ui/icons/Search';
import AttachFileIcon from '@material-ui/icons/AttachFile';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import InsertEmoticonIcon from '@material-ui/icons/InsertEmoticon';
import MicIcon from '@material-ui/icons/Mic';

import './Chat.css';

function Chat() {
   
    const[input, setInput] = useStste("");
    const [seed, setSeed] = useState("");

    useEffect(() => {
        setSeed(Math.floor(Math.random() * 5000));
    }, []);

    const sendMessage = (e) => {

    }



    return (
        <div className="chat">
            
            <div className="chat__header">
            <Avatar src="https://avatars.dicebear.com/api/human/Shubham2.svg"/>
            <div className="chat__headerInfo">
                <h3>Room Name</h3>
                <p>Last Seen at...</p>
            </div>
            <div className="chat__headerRight">
            <IconButton> <SearchIcon /></IconButton>
            <IconButton> <AttachFileIcon/></IconButton>
          <IconButton> <MoreVertIcon /></IconButton>

            </div>
            </div>
    <div className="chat__body">
      
      <p className={`chat__message ${true && "chat__reciever"}`}> 
      <span className="chat__name">Shubham Goyal</span>
      Hey
      <span className="chat__timestamp">10:14pm</span>
      </p>
      </div>
    <div className="chat__footer">
       <IconButton> <InsertEmoticonIcon /></IconButton>
       <form>
           <input value={input} type="text"  onChange={e}
               placeholder="Type a message"
           />
           <button onClick={sendMessage} 
           type="submit">Send a message</button>
       </form>
        <IconButton> <MicIcon /></IconButton>
    </div>
        </div>
    )
}

export default Chat;
